import React from "react";
import "./About.css";
function About() {
  return (
    <div>
      <h1
        style={{ textAlign: "center", fontFamily: "cursive", fontSize: "50px" }}
      >
        About
      </h1>
      <h5 style={{ textAlign: "center" }}>
        Who we are, what we do, and how we test products
      </h5>
    </div>
  );
}

export default About;
